import CreateGroup from "./pages/CreateGroup/CreateGroup.jsx"
import CreatePost from "./pages/CreatePost/CreatePost.jsx"
import Main from "./pages/Main/Main"
import Profile from "./pages/Profile/Profile"

import { ROUTE } from "./utils/consts.js"
import AuthForm from "./component/AuthForm/AuthForm.jsx"
import Friends from "./pages/Friends/Friends.jsx"
import Login from "./pages/Login/Login.jsx"
import Register from "./pages/Register/Register.jsx"
import Group from "./pages/Group/Group.jsx"

export const authRoutes = [
    {
        path: ROUTE.RECOMMENDATIONS,
        Component: Main
    },
    {
        path: ROUTE.PROFILE,
        Component: Profile
    },
    {
        path: ROUTE.MY_FRIENDS,
        Component: Friends
    },
    {
        path: ROUTE.RECIEVED_FRIEND_REQUESTS,
        Component: Friends
    },
    {
        path: ROUTE.SENT_FRIEND_REQUESTS,
        Component: Friends
    },
    {
        path: ROUTE.CREATE_POST,
        Component: CreatePost
    },
    {
        path: ROUTE.CREATE_GROUP,
        Component: CreateGroup
    },
]

export const publicRoutes = [
    {
        path: ROUTE.FEED,
        Component: Main
    },
    {
        path: ROUTE.LOGIN,
        Component: Login
    },
    {
        path: ROUTE.REGISTER,
        Component: Register
    },
    {
        path: ROUTE.USERS + "/:id",
        Component: Profile
    },
    {
        path: ROUTE.GROUP + "/:id",
        Component: Group
    }
]
